import React from 'react';
import "../pages/style/About.css";

class About extends React.Component{
    constructor(){
        super()
    }


    render(){
        return(
            <>
              <div id='aform'>
                 <table>
                    <tr><th>Contact Us</th></tr>
                 </table>
              </div>
            </>
        )
    }
}


export default About;
